function loadData(){$.ajax({type:"GET",url:"data/surveyData.json",dataType:"json",success:function(a){transportation(a.totals.transportation)},error:function(a){console.log("Error "+a.status),console.log(a)}})}function transportation(a){var s=a.titles,o=a.data,l=0,n=0,i=0,c=0,f=0;o.forEach(function(a,o){for(var e=0;e<a;e++){var r=s[o];if("Train"==r)l++;else if("Bus"==r)n++;else if("Car"==r)i++;else if("Walk"==r)c++;else if("Bike"==r)f++;else for(var t=r.split(",");e<t.length;e++)"Train"==t[0]?l++:"Bus"==t[0]?n++:"Car"==t[0]?i++:"Walk"==t[0]?c++:"Bike"==t[0]?f++:console.log("Invalid data")}});var e,r="fas fa-2x";for(e=0;e<l;e++)$("#trains").append($("<i class='"+r+" fa-subway'>"));for(e=0;e<n;e++)$("#buses").append($("<i class='"+r+" fa-bus'>"));for(e=0;e<i;e++)$("#cars").append($("<i class='"+r+" fa-car'>"));for(e=0;e<c;e++)$("#walks").append($("<i class='"+r+" fa-walking'>"));for(e=0;e<f;e++)$("#bikes").append($("<i class='"+r+" fa-bicycle'>"))}function drawChart(a){var o=google.visualization.arrayToDataTable([a]);new google.visualization.PieChart(document.querySelector(".left-top")).draw(o,{title:"Male & Female"})}google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(drawChart),$(document).ready(function(){loadData()});